function getObservaciones(form_selector, id_sistematizacion, parte=""){
	var datos = {
		funcion: 'getObservaciones',
		'p1': id_sistematizacion
	};
	$.ajax({
		url: url_sis,
		type: 'POST',
		dataType: 'json',
		data: datos,
		success: function(data) {
			if(parte == "sistematizacion")
				$(form_selector+" #div-desarrollo-sistematizacion").show();
			else
				$(form_selector+" #div-desarrollo-sistematizacion").hide();

			if(form_selector == "#form-modificar-sistematizacion"){
				$(form_selector+" :text").attr("readonly", true);
				$(form_selector+" textarea").attr("readonly", true);
				$(form_selector+" #BTN_modificar_Sistematizacion").hide();/*--------------------------Revidarrrr---------------------------------*/
			}

			if(form_selector == '#form-revisar-sistematizacion'){
				$(form_selector+" :text").removeClass("revision");
				$(form_selector+" textarea").removeClass("revision");
				$(form_selector+" #div-descripcion-experiencia").children().children("div").removeClass("revision");
				if(parte == "sistematizacion"){
					$(form_selector+" #div-desarrollo-sistematizacion :text").addClass("revision");
					$(form_selector+" #div-desarrollo-sistematizacion textarea").addClass("revision");
				}else{
					$(form_selector+" #div-planeacion-sistematizacion :text").addClass("revision");
					$(form_selector+" #div-planeacion-sistematizacion textarea").addClass("revision");
					$(form_selector+" #div-descripcion-experiencia").children().children("div").addClass("revision");
				}

			}

			if(data["TX_Observaciones"] != null){
				observaciones = JSON.parse(data["TX_Observaciones"]);
			}

			if(data["IN_Aprobacion_Planeacion"] == 1 || data["IN_Aprobacion_Planeacion"] == 3 || data["IN_Aprobacion_Sistematizacion"] == 1 || data["IN_Aprobacion_Sistematizacion"] == 3){	
				if(form_selector == "#form-revisar-sistematizacion"){
					$.each(observaciones, function(key, observacion){
						t_obs = Object.keys(observaciones[key][observaciones[key].length -1]);

						if(t_obs == "observacion"){
							if(observacion[observacion.length-1].observacion != "" && observacion[observacion.length-1].observacion != undefined && $(form_selector+" #"+key).hasClass("revision")){
								$(form_selector+" #"+key).css('background-color', '#FFFF99');
							}
						}
						if(t_obs == "temporal"){
							if(observacion[observacion.length-1].temporal != "" && observacion[observacion.length-1].temporal != undefined && $(form_selector+" #"+key).hasClass("revision")){


								$(form_selector+" #"+key).css('background-color', '#FFFF99');
							}
							observaciones_temp[key] = observacion[observacion.length-1].temporal;
							$(form_selector+" #Observacion_"+key).val(observacion);
						}
					});
					$(form_selector+" .btn-revision").show();
				}
			}
			if(data["IN_Aprobacion_Planeacion"] == 2 || data["IN_Aprobacion_Sistematizacion"] == 2){
				let div = data["IN_Aprobacion_Sistematizacion"] == 2 ? "#div-desarrollo-sistematizacion" : "#div-planeacion-sistematizacion";
				$(form_selector+" "+div+" .label-button").each(function(index, el) {
					$(this).html("").html("&nbsp;&nbsp;<button type='button' class='btn btn-xs btn-success' disabled>Sin observación</button>");
				});

				$.each(observaciones, function(key, observacion){
					if(observacion[observacion.length-1].observacion != ""){
						$($(form_selector+" "+div+" #"+key).parent().children(".label-button").children()[0]).removeClass("btn-success").addClass("btn-warning correccion").attr("disabled", false).attr("data-observacion", observacion[observacion.length-1].observacion).text("Ver observaciones");
						if(form_selector == "#form-modificar-sistematizacion"){
							estado = 2;
							$(form_selector+" "+div+" #"+key).attr("readonly", false);
							$(form_selector+" #BTN_modificar_Sistematizacion").show();
							if(key == "TX_Ambientacion" || key == "TX_Dispositivos" || key == "TX_Momentos"){
								$(form_selector+" #"+key).summernote("enable");
							}
						}
					}
					if(form_selector == "#form-revisar-sistematizacion"){
						$(form_selector+" :text").removeClass("revision");
						$(form_selector+" textarea").removeClass("revision");
						$(form_selector+" #div-descripcion-experiencia").children().children("div").removeClass("revision");
						$(form_selector+" .btn-revision").hide();
						$(form_selector+" #"+key).attr("readonly", true);
					}
				});
			}

			if(data["IN_Aprobacion_Planeacion"] == 3 || data["IN_Aprobacion_Sistematizacion"] == 3){
				segunda_revision = 1;
				$("#BTN_Guardar_revision").attr("data-revision", "segunda-revision")
			}

		},
		fail:function (data) {
		},
		async: false
	});
}

