function guardarSistematizacion(estado, notificacion){

	$("#form-guardar-sistematizacion .referente").each(function(index, el) {
		referentes[$(this).attr("id")] = $(this).val();
	});

	$("#form-guardar-sistematizacion .aplicabilidad").each(function(index, el) {
		aplicabilidad[$(this).attr("id")] = $(this).val();
	});


	var datos = new FormData();
	formulario = {};
	formulario['nombre_experiencia'] = $("#TX_Nombre_Exp").val();
	formulario['mes_experiencia'] = $("#SL_Mes_Exp").val();
	formulario['tema'] = $("#TX_Tema").val();
	formulario['materias'] = $("#TX_Materias").val();
	formulario['id_dupla'] = id_dupla;
	formulario['intencion'] = $("#TX_Intencion_Artistica").val();
	formulario['referentes'] = referentes;
	formulario['aplicabilidad_referentes'] = aplicabilidad;
	formulario['ambientacion'] = $("#TX_Ambientacion").summernote('code');
	formulario['dispositivos'] = $("#TX_Dispositivos").summernote('code');
	formulario['momentos'] = $("#TX_Momentos").summernote('code');
	formulario['estado'] = estado;
	formulario['id_artista'] = parent.idUsuario;
	datos.append('funcion', 'guardarSistematizacion');
	datos.append('p1', JSON.stringify(formulario));
	$.ajax({
		url: url_sis,
		contentType: false,
		processData: false,
		dataType: "html",
		type: "POST",
		data: datos,
		success: function(data){
			if (data == 1) {
				window.parent.sendNotificationUser(notificacion);
				limpiarCajasTexto('#form-guardar-sistematizacion');
				$("#SL_Mes_Exp").html(parent.getOptionsMes()).selectpicker("refresh");
				parent.mostrarAlerta("success","Operación exitosa","Se han guardado los datos correctamente.");
				$(".nav #li-registrar-sistematizacion").removeClass('active');
				$("#registrar-sistematizacion").removeClass('active');
				$(".nav #li-editar-sistematizacion").addClass('active');
				$("#li-editar-sistematizacion").show();
				$("#editar-sistematizacion").addClass('active');
				getSistematizacionesDupla(id_dupla,tabla_sistematizaciones_dupla);
			}else{
				parent.mostrarAlerta("error","Error","No se han podido guardar los datos, por favor inténtelo nuevamente.");
			}

		},error: function(data){
		},
		async: false
	});
}

