				$(form_selector+" #TX_Nombre_Exp").val(data["VC_Nombre_Experiencia"]);
				$(form_selector+" #SL_Mes_Exp").text(data["mes"]);
				$(form_selector+" #TX_Tema").val(data["TX_Tema"]);
