				$(form_selector+" #TX_Otros_Aspectos").val(data["TX_Otros_Aspectos"]);

				arrayReferentes = JSON.parse(data["TX_Referentes"]);
				arrayAplicabilidades = JSON.parse(data["TX_Aplicabilidad_Referentes"]);

