					$(form_selector+" #TX_Dispositivos").html(data["TX_Dispositivos"]);
					$(form_selector+" #TX_Momentos").html(data["TX_Momentos"]);
					$(form_selector+" #TX_Ambientacion").css({'border': '1px solid #ccc', "border-radius": "4px", "padding": "6px 12px", "background-color": "#eee", "min-height": "100px" });
					$(form_selector+" #TX_Dispositivos").css({'border': '1px solid #ccc', "border-radius": "4px", "padding": "6px 12px", "background-color": "#eee", "min-height": "100px" });
